select(2, ...).LoadData("APP_INFO","Global",[[return {version=403,lastSync=1571429085,message={id=0,msg=""},news={{title="TradeSkillMaster v4.8.14 Changelog",content="TSM v4.8.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with manual scans not recording some items correctly.<br />* [Classic] Removed guild bank sources from Gathering.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569992467,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-14-changelog/"},{title="TradeSkillMaster v4.8.13 Changelog",content="TSM v4.8.13 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Classic] Fixed issue with professions on non-English clients.<br />* [Classic] Fixed bug with profession crafts getting duplicated.<br />* [Classic] Added support for loading region data from the app.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569865513,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-13-changelog/"},{title="TradeSkillMaster v4.8.12 Changelog",content="TSM v4.8.12 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixes issues with profession windows that some people were experiencing.<br />* Fixed auction categories for Classic.<br />* Smaller enchanting fix.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569707953,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-12-changelog/"},{title="TradeSkillMaster v4.8.11 Changelog",content="TSM v4.8.11 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed scanning issues.<br />* Added support for Booty Bay Gazette prices.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569627291,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-11-changelog/"},{title="TradeSkillMaster v4.8.10 Changelog",content="TSM v4.8.10 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Updated TOC for WoW 8.2.5.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569513609,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-10-changelog/"},{title="TradeSkillMaster v4.8.9 Changelog",content="TSM v4.8.9 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed progress messages for full AH scans<br />* Further disenchant value updates for Classic<br />* Auction durations will show up properly in Classic<br />* Enchanting crafts should work directly from the TSM UI<br />* Various other crafting and trade skill related fixes for Classic<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1569193848,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-9-changelog/"},{title="Classic Pricing Data is now available through the TSM Application!",content="We've been hard at work setting up the infrastructure to process and distribute pricing data through the TSM Desktop Application and are happy to confirm that this is now available for Classic. This functionality relies on your diligent Auction House scanning, so this does not mean that you no longer need to manually scan on [...]",timestamp=1568706063,link="https://blog.tradeskillmaster.com/classic-pricing-data-is-now-available-through-the-tsm-application/"},{title="TradeSkillMaster v4.8.8 Changelog",content="TSM v4.8.8 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Added support for enchanting, smelting, and poisons for Classic<br />* Fixed various issues related to Crafting on Classic<br />* Updated disenchant values for both Classic and Retail<br />* Added more detailed disenchant/mill/prospecting information to the tooltip<br />* Fixed various errors seen while using TSM on Classic<br />* Fixed auction durations for Classic<br />* Fixed a few errors caused by incorrect translations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1568655306,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-8-changelog/"},{title="TradeSkillMaster v4.8.7 Changelog",content="TSM v4.8.7 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed error caused by a corrupted item cache.<br />* Fixed error when trying to create teh TSM macro on classic.<br />* Fixed positioning of TSM UI button on default UIs in classic.<br />* Fixed bug with cooking not showing properly in classic.<br />* Changed gold graph units from 1kg to 1g on classic.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567627613,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-7-changelog/"},{title="TradeSkillMaster v4.8.6 Changelog",content="TSM v4.8.6 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Made manual AH scan much more reliable on high-pop realms and added progress messages.<br />* Fixed issue with TSM scanning too many pages after doing a manual AH scan on classic.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1567404887,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-8-6-changelog/"}}}]]) --<APP_INFO,Global,1571429085>
